// src/LoginPage.js
import React from 'react';
import neulogo from './image/neu.PNG';
import {GoogleOAuthProvider, GoogleLogin} from '@react-oauth/google';
import './loginpage.css'; // Make sure to create this CSS file

const LoginPage = () => {
    const responseGoogle = (credentialResponse) => {
        console.log(credentialResponse);
        // Handle login success or failure here
    };

    return (
        <GoogleOAuthProvider clientId="YOUR_GOOGLE_CLIENT_ID"> {/* Replace with your client ID */}
            <div className="container">
                <div className="image-side">
                    <img src="your-image-url.jpg" alt="Login" />
                </div>
                <div className="login-side">
                    <img src={neulogo} alt="neu-logo"></img>
                    <h1>Login</h1>
                    <form>
                        <div className="form-group">
                            <label htmlFor="email">Email</label>
                            <input type="email" id="email" required />
                        </div>
                        <div className="form-group">
                            <label htmlFor="password">Password</label>
                            <input type="password" id="password" required />
                        </div>
                        <button type="submit">Login</button>
                    </form>
                    <div className="google-login">
                        <GoogleLogin
                            onSuccess={responseGoogle}
                            onFailure={responseGoogle}
                            cookiePolicy={'single_host_origin'}
                        />
                    </div>
                </div>
            </div>
        </GoogleOAuthProvider>
    );
};

export default LoginPage;
